import { useState, useEffect } from "react";
import FormularioFuncionario from "./FormularioFuncionario";
import FormularioMedicamento from "./FormularioMedicamento";
import "../DashboardFuncionario.css";

export default function DashboardFuncionario({ usuario }) {
  // Funcionarios
  const [funcionarios, setFuncionarios] = useState([]);
  const [editingFuncionario, setEditingFuncionario] = useState(null);

  // Medicamentos
  const [medicamentos, setMedicamentos] = useState([]);
  const [editingMedicamento, setEditingMedicamento] = useState(null);

  // Obtener funcionarios
  const fetchFuncionarios = async () => {
    try {
      const res = await fetch("http://localhost:5000/api/funcionarios");
      const data = await res.json();
      setFuncionarios(data);
    } catch (err) {
      console.error("Error funcionarios:", err);
    }
  };

  // Obtener medicamentos
  const fetchMedicamentos = async () => {
    try {
      const res = await fetch("http://localhost:5000/api/medicamentos");
      const data = await res.json();
      setMedicamentos(data);
    } catch (err) {
      console.error("Error medicamentos:", err);
    }
  };

  useEffect(() => {
    fetchFuncionarios();
    fetchMedicamentos();
  }, []);

  // Eliminar funcionario
  const handleEliminarFuncionario = async (rut) => {
    await fetch(`http://localhost:5000/api/funcionarios/${rut}`, { method: "DELETE" });
    fetchFuncionarios();
  };

  return (
    <div className="dashboard-funcionario">
      <h2>Bienvenido {usuario}</h2>

      {/* --- Sección Funcionarios --- */}
      <section>
        <h3>Funcionarios</h3>
        <button onClick={() => setEditingFuncionario({})}>Añadir Funcionario</button>
        {editingFuncionario && (
          <FormularioFuncionario
            funcionario={editingFuncionario}
            setEditing={setEditingFuncionario}
            refresh={fetchFuncionarios}
          />
        )}
        <table border="1">
          <thead>
            <tr>
              <th>RUT</th>
              <th>Nombres</th>
              <th>Apellidos</th>
              <th>Cargo</th>
              <th>Turno</th>
              <th>Asistencia</th>
              <th>Acciones</th>
            </tr>
          </thead>
          <tbody>
            {funcionarios.map(f => (
              <tr key={f.rut}>
                <td>{f.rut}</td>
                <td>{f.nombres}</td>
                <td>{f.apellidos}</td>
                <td>{f.cargo}</td>
                <td>{f.turno}</td>
                <td>{f.asistencia}</td>
                <td>
                  <button onClick={() => setEditingFuncionario(f)}>Editar</button>
                  <button onClick={() => handleEliminarFuncionario(f.rut)}>Eliminar</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      {/* --- Sección Medicamentos --- */}
      <section>
        <h3>Medicamentos</h3>
        <button onClick={() => setEditingMedicamento({})}>Añadir Medicamento</button>
        {editingMedicamento && (
          <FormularioMedicamento
            medicamento={editingMedicamento}
            setEditing={setEditingMedicamento}
            refresh={fetchMedicamentos}
          />
        )}
        <table border="1">
          <thead>
            <tr>
              <th>ID</th>
              <th>RUT Residente</th>
              <th>Nombre</th>
              <th>Dosis</th>
              <th>Caso SOS</th>
              <th>Médico Indicador</th>
              <th>Inicio</th>
              <th>Termino</th>
            </tr>
          </thead>
          <tbody>
            {medicamentos.map(m => (
              <tr key={m.id}>
                <td>{m.id}</td>
                <td>{m.rut_residente}</td>
                <td>{m.nombre}</td>
                <td>{m.dosis}</td>
                <td>{m.caso_sos ? "Sí" : "No"}</td>
                <td>{m.medico_indicador}</td>
                <td>{m.fecha_inicio}</td>
                <td>{m.fecha_termino}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>
    </div>
  );
}
